import{_ as l,c as i,o as r,a3 as a,j as e,a as o}from"./chunks/framework.CyEiTwkJ.js";const C=JSON.parse('{"title":"News","description":"","frontmatter":{},"headers":[],"relativePath":"news.md","filePath":"news.md"}'),t={name:"news.md"},n=a('<h1 id="news" tabindex="-1">News <a class="header-anchor" href="#news" aria-label="Permalink to &quot;News&quot;">​</a></h1><h2 id="april-8-2025" tabindex="-1">April 8, 2025 <a class="header-anchor" href="#april-8-2025" aria-label="Permalink to &quot;April 8, 2025&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2025_04_08</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2021_11_02</em>.</li><li><strong>New nodes added:</strong><ul><li>NUTM1 Renal Cell Carcinoma (NRCC)</li><li>Adenocarcinoma in Retrorectal Cystic Hamartoma (ARCH)</li><li>Xanthogranuloma (XGA)</li><li>Three new nodes (NVRINT, MPNWP, MDSWP) initially intended only oncotree_candidate_release were added to this release.</li></ul></li><li><strong>New mappings added</strong> OncoTree now includes expanded NCI and UMLS mappings, improving coverage for previously missing cancer classifications.</li></ul><h2 id="november-2-2021" tabindex="-1">November 2, 2021 <a class="header-anchor" href="#november-2-2021" aria-label="Permalink to &quot;November 2, 2021&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2021_11_02</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2020_10_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Desmoplastic/Nodular Medulloblastoma, NOS (DMBLNOS)</li><li>Desmoplastic/Nodular Medulloblastoma, SHH Subtype (DMBLSHH)</li><li>Anaplastic Medulloblastoma, NOS (AMBLNOS)</li><li>Anaplastic Medulloblastoma, Non-WNT, Non-SHH (AMBLNWS)</li><li>Anaplastic Medulloblastoma, Group 3 (AMBLNWSG3)</li><li>Anaplastic Medulloblastoma, Group 4 (AMBLNWSG4)</li><li>Anaplastic Medulloblastoma, SHH Subtype (AMBLSHH)</li><li>Medulloblastoma, NOS (MBLNOS)</li><li>Medulloblastoma, Non-WNT, Non-SHH (MBLNWS)</li><li>Medulloblastoma, Group 3 (MBLG3)</li><li>Medulloblastoma, Group 4 (MBLG4)</li><li>Medulloblastoma, SHH Subtype (MBLSHH)</li><li>Medulloblastoma, WNT Subtype (MBLWNT)</li><li>Medulloblastoma with Extensive Nodularity, NOS (MBENNOS)</li><li>Medulloblastoma with Extensive Nodularity, SHH Subtype (MBENSHH)</li><li>Pancreatic Neuroendocrine Carcinoma (PANEC) <em>in the original version of this news release this node was accidentally omitted</em></li></ul></li><li><strong>Nodes reclassified</strong><ul><li>The following list of oncotree codes had the mainType shortened to drop the suffix &quot;NOS&quot;: ADRENAL_GLAND, AMPULLA_OF_VATER, BILIARY_TRACT, BLADDER, BONE, BOWEL, BRAIN, BREAST, CERVIX, EYE, HEAD_NECK, KIDNEY, LIVER, LUNG, LYMPH, MYELOID, OTHER, OVARY, PANCREAS, PENIS, PERITONEUM, PLEURA, PNS, PROSTATE, SKIN, SOFT_TISSUE, STOMACH, TESTIS, THYMUS, THYROID, UTERUS, VULVA</li><li>Cholangiocarcinoma (CHOL) now has direct parent Intraductal Papillary Neoplasm of the Bile Duct (IPN) [previously: Biliary Tract (BILIARY_TRACT)]</li><li>Gallbladder Cancer (GBC) now has direct parent Intracholecystic Papillary Neoplasm (ICPN) [previously: Biliary Tract (BILIARY_TRACT)]</li></ul></li><li><strong>oncotree candidate release version additions:</strong><ul><li>Three new nodes intended only for version oncotree_candidate_release were added (NVRINT, MPNWP, MDSWP). These nodes will not be incorperated into oncotree latest stable.</li></ul></li><li><strong>resources added</strong><ul><li>rdf formatted OWL ontology and taxomomy files for recent oncotree versions have been added to our github repository. They can be explored <a href="https://github.com/cBioPortal/oncotree/tree/master/resources/rdf" target="_blank" rel="noreferrer">here <span class="text-primary oi oi-external-link"></span></a>.</li></ul></li></ul><h2 id="november-4-2020" tabindex="-1">November 4, 2020 <a class="header-anchor" href="#november-4-2020" aria-label="Permalink to &quot;November 4, 2020&quot;">​</a></h2><ul><li><strong>Ontology to Ontology Mapping tool available</strong><ul><li>The Ontology Mapping tool was developed to facilitate the mapping between different cancer classification systems. We currently support mapping between OncoTree, ICD-O, NCIt, UMLS and HemeOnc systems.</li><li>A mapping file containing mappings between the different ontologies and OncoTree codes as well as a python script to run the mapping is available on the OncoTree <a href="https://github.com/cBioPortal/oncotree/tree/master/scripts/ontology_to_ontology_mapping_tool" target="_blank" rel="noreferrer">GitHub page <span class="text-primary oi oi-external-link"></span></a>. Details are also available on the <a href="http://oncotree.info/images/../#/home?tab=mapping" target="_blank" rel="noreferrer">Mapping Tools page <span class="text-primary oi oi-external-link"></span></a>.</li><li>The mapping file is expected to grow as we curate more ontology mappings for OncoTree codes.</li></ul></li></ul><h2 id="october-1-2020" tabindex="-1">October 1, 2020 <a class="header-anchor" href="#october-1-2020" aria-label="Permalink to &quot;October 1, 2020&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2020_10_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2020_04_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Basal Cell Carcinoma of Prostate (BCCP)</li></ul></li><li><strong>Node deleted:</strong><ul><li>Porphyria Cutania Tarda (PCT)</li></ul></li><li><strong>Node with updated name:</strong><ul><li>Goblet Cell Adenocarcinoma of the Appendix (GCCAP) [previously: Goblet Cell Carcinoid of the Appendix (GCCAP)].</li></ul></li></ul><h2 id="april-1-2020" tabindex="-1">April 1, 2020 <a class="header-anchor" href="#april-1-2020" aria-label="Permalink to &quot;April 1, 2020&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2020_04_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2020_02_06</em>.</li><li><strong>New nodes added:</strong><ul><li>AML with Variant RARA translocation (AMLRARA)</li></ul></li><li><strong>Nodes reclassified:</strong><ul><li>Mixed Cancer Types (MIXED is now a child of Other (OTHER) [previously under: Cancer of Unknown Primary (CUP)].</li></ul></li></ul><h2 id="february-6-2020" tabindex="-1">February 6, 2020 <a class="header-anchor" href="#february-6-2020" aria-label="Permalink to &quot;February 6, 2020&quot;">​</a></h2><ul><li><strong>Web Link To Specific Nodes Available:</strong><ul><li>When providing web links to oncotree, you may include a search term as an optional argument and the oncotree you reference will be displayed with the search term located and highlighted. Use of this mechanism can be seen in the <a href="https://raw.githubusercontent.com/cBioPortal/oncotree/master/docs/resources/data_clinical_sample_remapped_summary.html" target="_blank" rel="noreferrer">example output <span class="text-primary oi oi-external-link"></span></a> for the OncoTree-to-OncoTree code mapping tool.</li><li>As an example, you can provide a direct link to the TumorType node PANET in oncotree version oncotree_2019_12_01 with this link: <code>http://oncotree.mskcc.org/#/home?version=oncotree_2019_12_01&amp;search_term=(PANET)</code></li></ul></li><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2020_02_06</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2020_02_01</em>.</li><li><strong>Nodes reclassified:</strong><ul><li>Gallbladder Cancer (GBC) is now a child of Biliary Tract (BILIARY_TRACT) [previously under: Intracholecystic Papillary Neoplasm (ICPN)].</li><li>Cholangiocarcinoma (CHOL) is now a child of Biliary Tract (BILIARY_TRACT) [previously under: Intraductal Papillary Neoplasm of the Bile Duct (IPN)].</li></ul></li></ul><h2 id="february-1-2020" tabindex="-1">February 1, 2020 <a class="header-anchor" href="#february-1-2020" aria-label="Permalink to &quot;February 1, 2020&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2020_02_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2019_12_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Intraductal Oncocytic Papillary Neoplasm (IOPN)</li><li>Intraductal Tubulopapillary Neoplasm (ITPN)</li><li>Intracholecystic Papillary Neoplasm (ICPN)</li><li>Intraductal Papillary Neoplasm of the Bile Duct (IPN)</li></ul></li><li><strong>Nodes reclassified:</strong><ul><li>Gallbladder Cancer (GBC) is now a child of Intracholecystic Papillary Neoplasm (ICPN) [previously under: Biliary Tract (BILIARY_TRACT)].</li><li>Cholangiocarcinoma (CHOL) is now a child of Intraductal Papillary Neoplasm of the Bile Duct (IPN) [previously under: Biliary Tract (BILIARY_TRACT)].</li></ul></li></ul><h2 id="december-1-2019" tabindex="-1">December 1, 2019 <a class="header-anchor" href="#december-1-2019" aria-label="Permalink to &quot;December 1, 2019&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2019_12_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2019_08_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Low-grade Appendiceal Mucinous Neoplasm (LAMN)</li></ul></li></ul><h2 id="august-1-2019" tabindex="-1">August 1, 2019 <a class="header-anchor" href="#august-1-2019" aria-label="Permalink to &quot;August 1, 2019&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2019_08_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2019_05_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Lacrimal Gland Tumor (LGT)</li><li>Adenoid Cystic Carcinoma of the Lacrimal Gland (ACLG)</li><li>Squamous Cell Carcinoma of the Lacrimal Gland (SCLG)</li><li>Basal Cell Adenocarcinoma (BCAC)</li><li>Carcinoma ex Pleomorphic Adenoma (CAEXPA)</li><li>Pleomorphic Adenoma (PADA)</li><li>Polymorphous Adenocarcinoma (PAC)</li><li>Atypical Lipomatous Tumor (ALT)</li></ul></li></ul><h2 id="may-2-2019" tabindex="-1">May 2, 2019 <a class="header-anchor" href="#may-2-2019" aria-label="Permalink to &quot;May 2, 2019&quot;">​</a></h2><ul><li><strong>OncoTree-to-OncoTree code mapping tool updated</strong><ul><li>The OncoTree-to-OncoTree mapping tool (now version 1.2) has been updated: <ul><li>it no longer requires the installation of the python &#39;requests&#39; module</li><li>it now is able to handle input files where lines end in carriage return (such as files saved from Microsoft Excel)</li></ul></li></ul></li></ul><h2 id="may-1-2019" tabindex="-1">May 1, 2019 <a class="header-anchor" href="#may-1-2019" aria-label="Permalink to &quot;May 1, 2019&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2019_05_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2019_03_01</em>.</li><li><strong>Nodes reclassified</strong><ul><li>Intestinal Ampullary Carcinoma (IAMPCA) MainType is now Ampullary Cancer [previously: Ampullary Carcinoma]</li><li>Mixed Ampullary Carcinoma (MAMPCA) MainType is now Ampullary Cancer [previously: Ampullary Carcinoma]</li><li>Pancreatobiliary Ampullary Carcinoma (PAMPCA) MainType is now Ampullary Cancer [previously: Ampullary Carcinoma]</li><li>Ependymoma (EPM) MainType is now Glioma [previously: CNS Cancer]</li><li>Rosai-Dorfman Disease (RDD) MainType is now Histiocytosis [previously: Histiocytic Disorder]</li></ul></li></ul><h2 id="march-26-2019" tabindex="-1">March 26, 2019 <a class="header-anchor" href="#march-26-2019" aria-label="Permalink to &quot;March 26, 2019&quot;">​</a></h2><ul><li><strong>OncoTree-to-OncoTree code mapping tool updated</strong><ul><li>The OncoTree-to-OncoTree mapping tool (now version 1.1) has been slightly improved, mainly by adding a separate section in the output summary for reporting OncoTree codes which were replaced automatically. Also, additional documentation and description of the tool has been added under the &quot;Mapping Tools&quot; tab.</li></ul></li></ul><h2 id="march-14-2019" tabindex="-1">March 14, 2019 <a class="header-anchor" href="#march-14-2019" aria-label="Permalink to &quot;March 14, 2019&quot;">​</a></h2><ul><li><strong>OncoTree-to-OncoTree code mapping tool available</strong><ul><li>A python program is now available for download under the webpage tab labeled &quot;Mapping Tools&quot;. This tool will rewrite OncoTree codes in a tabular clinical data file, mapping from one version of OncoTree to another. When additional guidance is necessary, the program will insert a column containing options and comments next to the ONCOTREE_CODE column. After selecting an appropriate OncoTree code for cases which require action, this extra column can be deleted to produce a fully re-mapped clinical data file. More details about this tool and how to use it are available under the &quot;Mapping Tools&quot; tab.</li><li>The OncoTree-to-OncoTree mapping tool relies on an expanded model of OncoTree node history. This is reflected in the Web API schema for Tumor Types, which now has added properties called &quot;precursors&quot; and &quot;revocations&quot;. Using these properties, and the existing &quot;history&quot; property, the tool is able to make proper mappings across OncoTree versions, and give suggestions when no clear mapping is available. It is also reflected in the main tree visualization of OncoTree, where a combination of these properties (when set) will be displayed in the pop-up information box with label &quot;Previous Codes&quot;.</li></ul></li></ul><h2 id="march-1-2019" tabindex="-1">March 1, 2019 <a class="header-anchor" href="#march-1-2019" aria-label="Permalink to &quot;March 1, 2019&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2019_03_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2019_02_01</em>.</li><li><strong>New node added:</strong><ul><li>NUT Carcinoma of the Lung (NUTCL)</li></ul></li><li><strong>Node with renamed OncoTree code:</strong><ul><li>Monomorphic Epitheliotropic Intestinal T-Cell Lymphoma (MEITL) [previously: MEATL]</li></ul></li><li><strong>Node with renamed OncoTree code and updated name:</strong><ul><li>Germ Cell Tumor with Somatic-Type Malignancy (GCTSTM) [previously: Teratoma with Malignant Transformation (TMT)]</li></ul></li><li><strong>Cross-version OncoTree code mapping tool coming soon</strong><ul><li>Development of a tool to map OncoTree codes between different versions of OncoTree is nearing completion.</li><li><span class="oi oi-warning text-danger" aria-hidden="true"></span> Related to this, users of the OncoTree Web API should be aware that we will soon be adding two additional properties to the output schema returned by the api/tumorTypes endpoints. The properties &quot;precursors&quot; and &quot;revocations&quot; will be added alongside the &quot;history&quot; property (having the same type: an array of strings). These will help distinguish the kinds of possible relationships to OncoTree nodes in prior versions of OncoTree. We expect this new schema to be backwards compatible, but if your language or tools requires an exactly matching JSON schema you will need to make adjustments.</li></ul></li></ul><h2 id="february-1-2019" tabindex="-1">February 1, 2019 <a class="header-anchor" href="#february-1-2019" aria-label="Permalink to &quot;February 1, 2019&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2019_02_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2018_11_01</em>.</li><li><strong>New node added:</strong><ul><li>Leiomyoma (LM)</li></ul></li></ul><h2 id="november-1-2018" tabindex="-1">November 1, 2018 <a class="header-anchor" href="#november-1-2018" aria-label="Permalink to &quot;November 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_11_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2018_09_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Gastrointestinal Neuroendocrine Tumors of the Esophagus/Stomach (GINETES)</li><li>High-Grade Neuroendocrine Carcinoma of the Esophagus (HGNEE)</li><li>High-Grade Neuroendocrine Carcinoma of the Stomach (HGNES)</li></ul></li><li><strong>Nodes reclassified:</strong><ul><li>Well-Differentiated Neuroendocrine Tumors of the Stomach (SWDNET) is now a child of Gastrointestinal Neuroendocrine Tumors of the Esophagus/Stomach (GINETES) [previously under: Bowel (BOWEL)].</li></ul></li></ul><h2 id="september-1-2018" tabindex="-1">September 1, 2018 <a class="header-anchor" href="#september-1-2018" aria-label="Permalink to &quot;September 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_09_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2018_08_01</em>.</li><li><strong>Nodes with adjusted History:</strong><ul><li>Myeloid Neoplasm (MNM) previous code: LEUK</li><li>B-Lymphoblastic Leukemia/Lymphoma (BLL) previous code: BALL</li><li>T-Lymphoblastic Leukemia/Lymphoma (TLL) previous code: TALL</li><li>Essential Thrombocythemia (ET) previous code: ETC</li><li>Polycythemia Vera (PV) previous code: PCV</li><li>Diffuse Large B-Cell Lymphoma, NOS (DLBCLNOS) previous code: DLBCL</li><li>Sezary Syndrome (SS) previous code: SEZS</li></ul></li></ul><h2 id="august-1-2018" tabindex="-1">August 1, 2018 <a class="header-anchor" href="#august-1-2018" aria-label="Permalink to &quot;August 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_08_01</em> is now the latest stable release. The previous stable version is still accessible as version <em>oncotree_2018_07_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Angiomatoid Fibrous Histiocytoma (AFH)</li><li>Clear Cell Sarcoma of Kidney (CCSK)</li><li>Ewing Sarcoma of Soft Tissue (ESST)</li><li>Extra Gonadal Germ Cell Tumor (EGCT)</li><li>Infantile Fibrosarcoma (IFS)</li><li>Malignant Glomus Tumor (MGST)</li><li>Malignant Rhabdoid Tumor of the Liver (MRTL)</li><li>Myofibromatosis (IMS)</li><li>Sialoblastoma (SBL)</li><li>Undifferentiated Embryonal Sarcoma of the Liver (UESL)</li></ul></li></ul><h2 id="july-1-2018" tabindex="-1">July 1, 2018 <a class="header-anchor" href="#july-1-2018" aria-label="Permalink to &quot;July 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_07_01</em> is now the latest stable release. The previous stable version is still accessible through the OncoTree web API by requesting version <em>oncotree_2018_06_15</em>.</li><li><strong>Node with renamed OncoTree code:</strong><ul><li>Atypical Chronic Myeloid Leukemia, BCR-ABL1- (ACML) [previously: aCML]</li></ul></li></ul><h2 id="june-15-2018" tabindex="-1">June 15, 2018 <a class="header-anchor" href="#june-15-2018" aria-label="Permalink to &quot;June 15, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_06_15</em> is now the latest stable release. The previous stable version is still accessible through the OncoTree web API by requesting version <em>oncotree_2018_06_01</em>.</li><li><strong>Nodes reclassified</strong><ul><li>Mature B-Cell Neoplasms (MBN) and Mature T and NK Neoplasms (MTNN) and their subnodes were relocated to be under Non-Hodgkin Lymphoma (NHL).</li><li>Rosai-Dorfman Disease (RDD) was relocated to be under Histiocytic and Dendritic Cell Neoplasms (HDCN). Previously RDD was under Lymphoid Neoplasm (LNM) in the Lymphoid category.</li></ul></li></ul><h2 id="june-1-2018" tabindex="-1">June 1, 2018 <a class="header-anchor" href="#june-1-2018" aria-label="Permalink to &quot;June 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_06_01</em> is now the latest stable release. The previous stable version is still accessible through the OncoTree web API by requesting version <em>oncotree_2018_05_01</em>.</li><li><strong>Blood and Lymph subtrees replaced with new Myeloid and Lymphoid subtrees:</strong><ul><li>23 nodes in the previous Blood subtree have been deleted or relocated/renamed. Affected OncoTree codes from this tree: BLOOD, BPDCN, HIST, LCH, ECD, LEUK, ALL, BALL, TALL, AMOL, AML, CLL, CML, CMML, HCL, LGLL, MM, MDS, MPN, ETC, MYF, PCV, SM</li><li>28 nodes in the previous Lymph subtree have been deleted or relocated/renamed. Affected OncoTree codes from this tree: LYMPH, HL, CHL, NLPHL, NHL, BCL, BL, DLBCL, MALTL, FL, MCL, MZL, MBCL, NMZL, PCNSL, PEL, SLL, SMZL, WM, TNKL, CTCL, MYCF, SEZS, PTCL, ALCL, AITL, PTCLNOS, RD</li><li>122 nodes in the current Lymphoid subtree have been added or relocated/renamed from previous subtrees. OncoTree codes in this new subtree are: LYMPH, LATL, LBGN, LNM, BLL, BLLRGA, BLLHYPER, BLLHYPO, BLLIAMP21, BLLETV6RUNX1, BLLTCF3PBX1, BLLIL3IGH, BLLBCRABL1, BLLKMT2A, BLLBCRABL1L, BLLNOS, HL, CHL, LDCHL, LRCHL, MCCHL, NSCHL, NLPHL, MBN, ALKLBCL, AHCD, BCLU, BPLL, BL, BLL11Q, CLLSLL, DLBCLCI, DLBCLNOS, ABC, GCB, EBVDLBCLNOS, EBVMCU, EP, FL, DFL, ISFN, GHCD, HHV8DLBCL, HCL, HGBCL, HGBCLMYCBCL2, IVBCL, LBLIRF4, LYG, LPL, WM, MCL, ISMCL, MZL, EMALT, NMZL, SMZL, MCBCL, MGUS, MGUSIGA, MGUSIGG, MGUSIGM, MIDD, MIDDA, MIDDO, MHCD, PTFL, PCM, PLBL, PCLBCLLT, PCFCL, PCNSL, PEL, PMBL, SPB, SBLU, HCL-V, SDRPL, THRLBCL, MTNN, ATLL, ANKL, ALCL, ALCLALKN, ALCLALKP, BIALCL, AITL, CLPDNK, EATL, ENKL, FTCL, HSTCL, HVLL, ITLPDGI, MEATL, MYCF, NPTLTFH, PTCL, PCATCL, PCLPD, LYP, PCALCL, PCSMTPLD, PCAECTCL, PCGDTCL, SS, SPTCL, SEBVTLC, TLGL, TPLL, NHL, PTLD, CHLPTLD, FHPTLD, IMPTLD, MPTLD, PHPTLD, PPTLD, RDD, TLL, ETPLL, NKCLL</li><li>101 nodes in the current Myeloid subtree have been added or relocated/renamed from previous subtrees. OncoTree codes in this new subtree are: MYELOID, MATPL, MBGN, MNM, ALAL, AUL, MPALBCRABL1, MPALKMT2A, MPALBNOS, MPALTNOS, AML, AMLMRC, AMLRGA, AMLRBM15MKL1, AMLBCRABL1, AMLCEBPA, AMLNPM1, AMLRUNX1, AMLCBFBMYH11, AMLGATA2MECOM, AMLDEKNUP214, AMLRUNX1RUNX1T1, AMLMLLT3KMT2A, APLPMLRARA, AMLNOS, AM, AMLMD, AWM, ABL, AMKL, AMOL, AMML, APMF, PERL, MPRDS, MLADS, TAM, MS, TMN, TAML, TMDS, BPDCN, HDCN, JXG, ECD, FRCT, FDCS, HS, IDCT, IDCS, LCH, LCS, MCD, CMCD, MCSL, SM, ASM, ISM, SMMCL, SSM, SMAHN, MDS, MDSEB, MDSEB1, MDSEB2, MDSID5Q, MDSMD, MDSRS, MDSRSMD, MDSRSSLD, MDSSLD, MDSU, RCYC, MDS/MPN, aCML, CMML, CMML0, CMML1, CMML2, JMML, MDSMPNRST, MDSMPNU, MNGLP, MLNER, MLNFGFR1, MLNPCM1JAK2, MLNPDGFRA, MLNPDGFRB, MPN, CELNOS, CML, CMLBCRABL1, CNL, ET, ETMF, MPNU, PV, PVMF, PMF, PMFPES, PMFOFS</li></ul></li><li><strong>Nodes reclassified</strong><ul><li>Adrenocortical Adenoma (ACA) MainType is now Adrenocortical Adenoma [previously: Adrenocortical Carcinoma]</li><li>Ampulla of Vater (AMPULLA_OF_VATER) MainType is now Ampullary Cancer [previously: Ampullary Carcinoma]</li><li>Parathyroid Cancer (PTH) MainType is now Parathyroid Cancer [previously: Head and Neck Cancer]</li><li>Parathyroid Carcinoma (PTHC) MainType is now Parathyroid Cancer [previously: Head and Neck Cancer]</li><li>Follicular Dendritic Cell Sarcoma (FDCS) was moved from the Soft Tissue subtree into the Myeloid subtree with direct parent Histiocytic and Dendritic Cell Neoplasms (HDCN)</li><li>Interdigitating Dendritic Cell Sarcoma (IDCS) was moved from the Soft Tissue subtree into the Myeloid subtree with direct parent Histiocytic and Dendritic Cell Neoplasms (HDCN)</li></ul></li><li><strong>New nodes added:</strong><ul><li>Inverted Urothelial Papilloma (IUP)</li><li>Urothelial Papilloma (UPA)</li><li>Oncocytic Adenoma of the Thyroid (OAT)</li></ul></li><li><strong>Character set simplification</strong><ul><li>Salivary Gland-Type Tumor of the Lung (SGTTL) used to contain a unicode character for a horizontal dash. This punctuation mark is now a hyphen.</li></ul></li></ul><h2 id="may-1-2018" tabindex="-1">May 1, 2018 <a class="header-anchor" href="#may-1-2018" aria-label="Permalink to &quot;May 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_05_01</em> is now the latest stable release. The previous stable version is still accessible through the OncoTree web API by requesting version <em>oncotree_2018_04_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Primary CNS Melanocytic Tumors (PCNSMT)</li><li>Melanocytoma (MELC)</li></ul></li><li><strong>Node reclassified</strong><ul><li>Primary CNS Melanoma (PCNSM) now is a child of Primary CNS Melanocytic Tumors (PCNSMT) [previously under: CNS/Brain].</li></ul></li></ul><h2 id="april-23-2018" tabindex="-1">April 23, 2018 <a class="header-anchor" href="#april-23-2018" aria-label="Permalink to &quot;April 23, 2018&quot;">​</a></h2>',46),s=e("ul",null,[e("li",null,[e("strong",null,"New Web API Version Available"),e("ul",null,[e("li",null,[o("A new version (v1.0.0) of the OncoTree Web API is available. It can be explored here: "),e("a",{href:"http://oncotree.mskcc.org/swagger-ui.html",target:"_blank",rel:"noreferrer"},"http://oncotree.mskcc.org/swagger-ui.html"),o(),e("br"),o(" The previous version is still available, but is scheduled to be discontinued May 31, 2018 You can continue to access the previous version (v0.0.1) in its original location summarized here: ~~"),e("a",{href:"http://oncotree.mskcc.org/oncotree/swagger-ui.html~~",target:"_blank",rel:"noreferrer"},"http://oncotree.mskcc.org/oncotree/swagger-ui.html~~")])])]),e("li",null,[e("strong",null,"Details and Migration Guidance"),e("ul",null,[e("li",null,[o("The base URL for accessing all API functionality is being simplified from ~~"),e("a",{href:"http://oncotree.mskcc.org/oncotree/~~",target:"_blank",rel:"noreferrer"},"http://oncotree.mskcc.org/oncotree/~~"),o(" to "),e("a",{href:"http://oncotree.mskcc.org/",target:"_blank",rel:"noreferrer"},"http://oncotree.mskcc.org/")]),e("li",null,[e("span",{class:"oi oi-warning text-danger","aria-hidden":"true"}),o(" The /api/tumor_types.txt endpoint is now deprecated. It is scheduled for deletion as part of the next API version release.")]),e("li",null,[o("Most endpoint paths in the API remain the same and provide the same services. Exceptions are: "),e("ul",null,[e("li",null,'/api/tumorTypes used to accept a query parameter ("flat") which controlled the output format for receiving a tree representation or a flat representation of the full set of TumorTypes. Now this endpoint always returns a flat list of all TumorTypes and a new endpoint path (/api/tumorTypes/tree) is used to retrieve a tree representation of the OncoTree. Previous requests which included "flat=false" should be adjusted to use the /api/tumorTypes/tree endpoint. Otherwise "flat=true" should be dropped from the request.'),e("li",null,'/api/tumorTypes used to accept a query parameter ("deprecated") which is no longer recognized. This parameter should be dropped from requests. Deprecated OncoTree codes can instead be found in the history attribute of the response.'),e("li",null,"the POST request endpoint (/api/tumorTypes/search) which accepted a list of TumorType queries has been deprecated and is no longer available through the swagger-ui interface. The GET request endpoint /api/tumorTypes/search/{type}/{query} remains available as before. If you previously submitted an array of query requests, you should iterate through the array and call the GET request endpoint to make one query per request.")])]),e("li",null,[o("The output format (schema) of many endpoints has been simplified. You will need to adjust your result handling accordingly. Changes include: "),e("ul",null,[e("li",null,'responses no longer include a "meta" element with associated code and error messages. Instead HTTP status codes are set appropriately and error messages are supplied in message bodies. Responses also no longer contain a "data" element. Objects representing the API output are directly returned instead.'),e("li",null,"MainType values are no longer modeled as objects. Each MainType value is now represented as a simple string. The /api/mainTypes endpoint now returns an array of strings rather than an object mapping MainType names to MainType objects."),e("li",{"UMLS:":"","[CL497188,C1510796],NCI:":"","[C123384,C40361]":""},'TumorType values no longer contain elements "id", "deprecated", "links", "NCI", "UMLS". A new element ("externalReferences") has been added which contains a JSON object mapping external authority names to arrays of associated identifiers. Such as "externalReferences":')])]),e("li",null,'Argument validation has been strengthened for several parameters, such as "type" and "levels" in the /api/tumorTypes/search/{type}/{query} endpoint. Now improper arguments cause an a HTTP status response indicating error, with a description of the problem in the body.'),e("li",null,[o("Some requests which fail to find matching entities now return NOT_FOUND HTTP status code 404 rather than an empty result. Examples: "),e("a",{href:"http://oncotree.mskcc.org/api/tumorTypes/search/code/TEST_UNDEFINED_CODE",target:"_blank",rel:"noreferrer"},"http://oncotree.mskcc.org/api/tumorTypes/search/code/TEST_UNDEFINED_CODE"),o(" or "),e("a",{href:"http://oncotree.mskcc.org/api/crosswalk?vocabularyId=ICDO&conceptId=C15",target:"_blank",rel:"noreferrer"},"http://oncotree.mskcc.org/api/crosswalk?vocabularyId=ICDO&conceptId=C15")])])])],-1),c=a('<h2 id="april-1-2018" tabindex="-1">April 1, 2018 <a class="header-anchor" href="#april-1-2018" aria-label="Permalink to &quot;April 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_04_01</em> is now the latest stable release. The previous stable version is still accessible through the OncoTree web API by requesting version <em>oncotree_2018_03_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Adamantinoma (ADMA)</li><li>Tubular Adenoma of the Colon (TAC)</li><li>Parathyroid Cancer (PTH)</li><li>Parathyroid Carcinoma (PTHC)</li><li>Renal Neuroendocrine Tumor (RNET)</li></ul></li></ul><h2 id="march-1-2018" tabindex="-1">March 1, 2018 <a class="header-anchor" href="#march-1-2018" aria-label="Permalink to &quot;March 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_03_01</em> is now the latest stable release. The previous stable version is still accessible through the OncoTree web API by requesting version <em>oncotree_2018_02_01</em>.</li><li><strong>New node added:</strong><ul><li>Ganglioneuroma (GN)</li></ul></li><li><strong>Node reclassified</strong><ul><li>Rhabdoid Cancer (MRT) now has direct parent Kidney (KIDNEY) [previously: Wilms&#39; Tumor (WT)] Main type is now &quot;Rhabdoid Cancer&quot; [previously: Wilms Tumor]</li></ul></li></ul><h2 id="february-7-2018" tabindex="-1">February 7, 2018 <a class="header-anchor" href="#february-7-2018" aria-label="Permalink to &quot;February 7, 2018&quot;">​</a></h2><ul><li><strong>OncoTree format expanded to support deeper tree nodes</strong><ul><li>To support upcoming expansion of the OncoTree, the 5 named levels of the OncoTree {<em>Primary</em>, <em>Secondary</em>, <em>Tertiary</em>, <em>Quaternary</em>, <em>Quinternary</em>} have been dropped in favor of level numbers {1, 2, 3, 4, 5, ...}. Web API functions have been adjusted accordingly, and an API function which outputs a table format of the OncoTree has been adjusted to output 7 levels of depth.</li></ul></li><li><strong>Additional improvements to the website</strong> : <ul><li>tab-style navigation</li><li>more prominent version selection information</li><li>a new <strong>News</strong> page</li></ul></li></ul><h2 id="february-1-2018" tabindex="-1">February 1, 2018 <a class="header-anchor" href="#february-1-2018" aria-label="Permalink to &quot;February 1, 2018&quot;">​</a></h2><ul><li><strong>New Stable Release</strong> OncoTree version <em>oncotree_2018_02_01</em> is now the latest stable release. The previous stable version is still accessible for use through version name <em>oncotree_2018_01_01</em>.</li><li><strong>New nodes added:</strong><ul><li>Adenosquamous Carcinoma of the Gallbladder (GBASC)</li><li>Gallbladder Adenocarcinoma, NOS (GBAD)</li><li>Small Cell Gallbladder Carcinoma (SCGBC)</li><li>Juvenile Secretory Carcinoma of the Breast (JSCB)</li><li>Osteoclastic Giant Cell Tumor (OSGCT)</li><li>Peritoneal Serous Carcinoma (PSEC)</li></ul></li><li><strong>Nodes reclassified</strong> [from: Embryonal Tumor, to: Peripheral Nervous System]: <ul><li>Ganglioneuroblastoma (GNBL)</li><li>Neuroblastoma (NBL)</li></ul></li><li><strong>Node with renamed OncoTree code:</strong><ul><li>Spindle Cell Carcinoma of the Lung (SPCC) [previously: SpCC]</li></ul></li></ul>',8),u=[n,s,c];function d(h,m,p,L,b,T){return r(),i("div",null,u)}const y=l(t,[["render",d]]);export{C as __pageData,y as default};
